package com.salespage.salespageservice.domains.entities;import com.salespage.salespageservice.app.dtos.SellerStoreDto;import com.salespage.salespageservice.domains.entities.infor.Rate;import lombok.Data;import org.bson.types.ObjectId;import org.springframework.data.annotation.Id;import org.springframework.data.mongodb.core.mapping.Document;import org.springframework.data.mongodb.core.mapping.Field;@Data@Document("store")public class SellerStore extends  BaseEntity{  @Id  private ObjectId id;  @Field("store_name")  private String storeName;  @Field("owner_store_name")  private String ownerStoreName;  @Field("image_store_url")  private String imageStoreUrl;  @Field("rate")  private Rate rate;  public void assignFromSellerStoreDto(SellerStoreDto sellerStoreDto) {    storeName = sellerStoreDto.getStoreName();  }}